import React from "react";
import ReactDom from "react-dom";
import "./header.css";

const Header = () => {
	return (
		<div class="header-container">
			<div class="overlay">
			<div class="header-image">
				<div class="header-content">
					<header-title>Insert Inspirational Quote</header-title>
				</div>
			</div>
			</div>
		</div>
	);
};

export default Header;
